import React, { Component } from 'react'
import { withRouter } from 'react-router'
import TextField from 'shared/textField'
import { getLogo } from '../utils'
import Button from 'shared/button'

const requiredFields = new Set()

function getCurrentState () {
  return {}
}

export class UpdateToken extends Component {
  defaultState = {
    requestInProgress: false,
    token: ''
  }

  state = { ...this.defaultState, ...getCurrentState() }

  onChange = () => event => {
    const { value } = event.target

    this.setState(state => ({
      ...state,
      token: value
    }))
  }

  render () {
    const { bank } = this.props.params
    const { token } = this.state
    const fakeData = 'password'
    return (
      <div className='synchronization'>
        <div className='synchronization--select-bank synchronization--select-bank-bold synchronization--margin-top'>
          <p>{bank.toUpperCase()}</p>
          <img className=' synchronization__logo' {...getLogo(bank)} />
        </div>

        <div className='synchronization--credentials-user synchronization--margin-top'>
          <TextField
            label='Usuario'
            value={fakeData}
            type='password'
            disabled
          />

          <div className='synchronization--margin-left'>
            <TextField
              label='ContraseÃ±a'
              value={fakeData}
              type='password'
              disabled
            />
          </div>
          <div className='synchronization--margin-left'>
            <TextField
              label='Token'
              value={token}
              onChange={this.onChange()}
              ref={r => requiredFields.add(r)}
              required
            />
          </div>
        </div>
        <div>
          <Button className='synchronization--margin-top' icon='cancel'>
            Cancelar
          </Button>
          <Button
            buttonStyle='primary'
            type='submit'
            className='synchronization--margin-top'
          >
            Actualizar
          </Button>
        </div>
      </div>
    )
  }
}

export default withRouter(UpdateToken)
